import React from 'react';
import CartItem from '../Cart/CartItem';
import './ProductList.css'; // CSS file for styling the list

const ProductList = () => {
    // Dummy product data - replace with real data as needed
    const products = [
        { id: 1, productName: "Product 1", price: "$100" },
        { id: 2, productName: "Product 2", price: "$200" },
        { id: 3, productName: "Product 3", price: "$300" },
        { id: 4, productName: "Product 4", price: "$400" },
        { id: 5, productName: "Product 5", price: "$500" },
        { id: 6, productName: "Product 6", price: "$600" },
    ];

    return (
        <div className="product-list">
            {products.map(product => (
                <CartItem key={product.id} productName={product.productName} price={product.price} />
            ))}
        </div>
    );
};

export default ProductList;
